import React from "react";
import {NavLink} from "react-router-dom";

const MenuLogin = () => {

  return (
    <div className="o-row o-row-center-y">
    <div className="o-col o-col--lg25">
      <NavLink to="/logowanie" className="btn">Zaloguj</NavLink>
      <NavLink to="/rejestracja" className="btn">Załóż konto</NavLink>
    </div>
    </div>
  )
}

export default MenuLogin;
